import React from 'react';

function Footer() {   
    return (
    <div class="footer" id="footer">
        <a href="https://github.com/"><img src="https://img.icons8.com/color/48/000000/github.png" alt="Github" class="icon"/></a>
        <a href="https://www.linkedin.com/"><img src="https://img.icons8.com/color/48/000000/linkedin.png" alt="LinkedIn" class="icon"/></a>
        <a href="https://twitter.com/"><img src="https://img.icons8.com/color/48/000000/twitter.png" alt="Twitter" class="icon"/></a>
        <a href="https://stackoverflow.com/"><img src="https://img.icons8.com/color/48/000000/stackoverflow.png" alt="Stack Overflow" class="icon"/></a>
        <p>
        copyright &copy; johnSmith 
        </p>

    </div>
    )
}

export default Footer;
